import React from 'react';

const Post = ({ post }) => {
    return (
        <div className="post">
            {post.images && post.images.length > 0 && (
                <img src={post.images[0]} alt={post.title} />
            )}
            <h3>{post.title}</h3>
            <p>{post.description}</p> {/* Alterado de conteudo para description */}
        </div>
    );
};

export default Post;
